import React from 'react'
import Unit from './Unit'

const UnitsList = (props) => {
  return (
    <ul>
      {props.units.map((unit) => (
        <Unit 
        key={unit.id}
        title={unit.title}
        releaseDate={unit.releaseDate}
        openingText={unit.openingText}
        />
      ))}
      </ul>
  );
};

export default UnitsList;
